montageDefine("daa4856","vendor/requirejs/tests/urlfetch/urlfetch.html",{text:'<!DOCTYPE html><html><head>\n    <title>require.js: urlFetch Mapping Test</title>\n    <script src=../../require.js></script>\n    <script src=../doh/runner.js></script>\n    <script src=../doh/_browserRunner.js></script>\n    <script>\n    require({\n            baseUrl: "./",\n            paths: {\n                \'one\' : \'two\',\n                \'two\' : \'two\',\n                \'three\': \'three\',\n                \'four\': \'three\'\n            }\n        },\n        ["require", "one", "two", "three", "four"],\n        function(require, one, two, three, four) {\n            doh.register(\n                "urlfetch", \n                [\n                    function urlfetch(t){\n                        //First confirm there is only one script tag for each\n                        //module:\n                        var scripts = document.getElementsByTagName("script"),\n                            i, counts = {}, url, props, something;\n                        for (var i = scripts.length - 1; i > -1; i--) {\n                            url = scripts[i].href;\n                            if (url) {\n                                if (!(url in counts)) {\n                                    counts[url] = 0;\n                                }\n                                counts[url] += 1;\n                            }\n                        }\n\n                        //Now that we counted all the modules make sure count\n                        //is always one.\n                        for (prop in counts) {\n                            t.is(1, counts[prop]);\n                        }\n\n                        t.is("one", one.name);\n                        t.is("one", two.oneName);\n                        t.is("two", two.name);\n                        t.is("three", three.name);\n                        t.is("three", four.threeName);\n                        t.is("four", four.name);\n                    }\n                ]\n            );\n            doh.run();\n        }\n    );\n    </script>\n</head>\n<body>\n    <h1>require.js: urlFetch Mapping Test</h1>\n    <p>Make sure that multiple modules mapped to the same URL only get\n    the URL fetched once.</p>\n    <p>Check console for messages</p>\n\n\n</body></html>'});